INSERT INTO `wp_postmeta` VALUES("138", "5", "b2_title", "Как зарабатывать с компанией GreenWay?");
INSERT INTO `wp_postmeta` VALUES("139", "5", "_b2_title", "field_609281c4d0565");
INSERT INTO `wp_postmeta` VALUES("140", "5", "b2-1_title", "Зароботок на розничной торговле товаром");
INSERT INTO `wp_postmeta` VALUES("141", "5", "_b2-1_title", "field_609281f3ed049");
INSERT INTO `wp_postmeta` VALUES("142", "5", "b2-1_text", "Каждый месяц вам необходимо покупать и реализовывать продукции на 50 баллов. За все, что будет куплено вами сверх данной суммы, компания будет платить 40% от стоимости товара в баллах.");
INSERT INTO `wp_postmeta` VALUES("143", "5", "_b2-1_text", "field_6092821aed04a");
