INSERT INTO `wp_postmeta` VALUES("174", "41", "about_text", "<p class=\"about__inner-text\">В компании GreenWay вы сможете построить свой собственный бизнес и получать стабильный доход, работая по готовой модели<br>Ваш доход может расти настолько, насоклько Вы этого пожелаете!</p>\r\n<p class=\"about__inner-text\">Всего за 3 года компания открыла представительства в 33 странах мира: России, Казахстане, Киргизии, Республике Беларусь, Украине, Турции и странах Евросоюза, запустили 205 региональных центров в 34 городах. И это только начало.</p>");
