INSERT INTO `wp_postmeta` VALUES("303", "72", "_home", "field_6092718e59390");
INSERT INTO `wp_postmeta` VALUES("304", "72", "home_title", "<h1 class=\"main__inner-title\">Зарабатывайте\r\nс компанией GreenWay</h1>");
INSERT INTO `wp_postmeta` VALUES("305", "72", "_home_title", "field_6092718e59390");
INSERT INTO `wp_postmeta` VALUES("306", "72", "home_sub_title", "Создайте стабильный и долгосрочный бизнес на эко-продуктах компании GreenWay, под руководством опытных наставников");
INSERT INTO `wp_postmeta` VALUES("307", "72", "_home_sub_title", "field_60927ee86cead");
