INSERT INTO `wp_postmeta` VALUES("314", "72", "b2_title", "Как зарабатывать с компанией GreenWay?");
INSERT INTO `wp_postmeta` VALUES("315", "72", "_b2_title", "field_609281c4d0565");
INSERT INTO `wp_postmeta` VALUES("316", "72", "b2-1_title", "Зароботок на розничной торговле товаром");
INSERT INTO `wp_postmeta` VALUES("317", "72", "_b2-1_title", "field_609281f3ed049");
INSERT INTO `wp_postmeta` VALUES("318", "72", "b2-1_text", "Каждый месяц вам необходимо покупать и реализовывать продукции на 50 баллов. За все, что будет куплено вами сверх данной суммы, компания будет платить 40% от стоимости товара в баллах.");
INSERT INTO `wp_postmeta` VALUES("319", "72", "_b2-1_text", "field_6092821aed04a");
INSERT INTO `wp_postmeta` VALUES("320", "72", "b2-2_title", "Бонус наставника");
INSERT INTO `wp_postmeta` VALUES("321", "72", "_b2-2_title", "field_6092838dbe6f1");
INSERT INTO `wp_postmeta` VALUES("322", "72", "b2-2_text", "Основываясь на своём опыте, вы сможете приглашать новых партнёров в компанию. За каждого приглашённого партнёра Greenway, вы будете получать по 700 рублей. Выплаты идут каждый месяц, то есть система будет записывать каждого приглашённого вами человека как вашего реферала и каждый месяц, когда его аккаунт будет «активен», вы будете получать 700 рублей.");
INSERT INTO `wp_postmeta` VALUES("323", "72", "_b2-2_text", "field_6092838fbe6f2");
INSERT INTO `wp_postmeta` VALUES("324", "72", "b2-3_title", "Партнерская программа");
INSERT INTO `wp_postmeta` VALUES("325", "72", "_b2-3_title", "field_609283c5be6f3");
INSERT INTO `wp_postmeta` VALUES("326", "72", "b2-3_text", "Вы также будете получать бонус за оборот ваших рефералов. И чем больше их оборот, тем больше вы будете зарабатывать. Итоговая сумма оборота высчитывается со всех рефералов до девятого поколения. То есть, если ваш реферал сам стал наставником, то его реферал одновременно и ваш (но без бонуса наставника).");
INSERT INTO `wp_postmeta` VALUES("327", "72", "_b2-3_text", "field_609283c7be6f4");
INSERT INTO `wp_postmeta` VALUES("328", "72", "about_title", "О компании<br>GreenWay");
INSERT INTO `wp_postmeta` VALUES("329", "72", "_about_title", "field_60928480f0cf6");
INSERT INTO `wp_postmeta` VALUES("330", "72", "about_text", "<p class=\"about__inner-text\">В компании GreenWay вы сможете построить свой собственный бизнес и получать стабильный доход, работая по готовой модели<br>Ваш доход может расти настолько, насоклько Вы этого пожелаете!</p>\r\n<p class=\"about__inner-text\">Всего за 3 года компания открыла представительства в 33 странах мира: России, Казахстане, Киргизии, Республике Беларусь, Украине, Турции и странах Евросоюза, запустили 205 региональных центров в 34 городах. И это только начало.</p>");
