INSERT INTO `wp_posts` VALUES("48", "1", "2021-05-05 14:39:26", "2021-05-05 11:39:26", "a:10:{s:4:\"type\";s:7:\"wysiwyg\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:1;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:634:\"Основываясь на своём опыте, вы сможете приглашать новых партнёров в компанию. За каждого приглашённого партнёра Greenway, вы будете получать по 700 рублей. Выплаты идут каждый месяц, то есть система будет записывать каждого приглашённого вами человека как вашего реферала и каждый месяц, когда его аккаунт будет «активен», вы будете получать 700 рублей.\";s:4:\"tabs\";s:3:\"all\";s:7:\"toolbar\";s:5:\"basic\";s:12:\"media_upload\";i:0;s:5:\"delay\";i:1;}", "B2-2 text", "b2-2_text", "publish", "closed", "closed", "", "field_6092838fbe6f2", "", "", "2021-05-05 14:39:26", "2021-05-05 11:39:26", "", "35", "http://localhost/greenway/?post_type=acf-field&p=48", "9", "acf-field", "", "0");
