INSERT INTO `wp_posts` VALUES("50", "1", "2021-05-05 14:39:26", "2021-05-05 11:39:26", "a:10:{s:4:\"type\";s:7:\"wysiwyg\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:1;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:553:\"Вы также будете получать бонус за оборот ваших рефералов. И чем больше их оборот, тем больше вы будете зарабатывать. Итоговая сумма оборота высчитывается со всех рефералов до девятого поколения. То есть, если ваш реферал сам стал наставником, то его реферал одновременно и ваш (но без бонуса наставника).\";s:4:\"tabs\";s:3:\"all\";s:7:\"toolbar\";s:5:\"basic\";s:12:\"media_upload\";i:0;s:5:\"delay\";i:1;}", "B2-3 text", "b2-3_text", "publish", "closed", "closed", "", "field_609283c7be6f4", "", "", "2021-05-05 14:39:26", "2021-05-05 11:39:26", "", "35", "http://localhost/greenway/?post_type=acf-field&p=50", "11", "acf-field", "", "0");
