INSERT INTO `wp_posts` VALUES("52", "1", "2021-05-05 14:43:22", "2021-05-05 11:43:22", "a:10:{s:4:\"type\";s:7:\"wysiwyg\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:1;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:805:\"<p class=\"about__inner-text\">В компании GreenWay вы сможете построить свой собственный бизнес и получать стабильный доход, работая по готовой модели<br>Ваш доход может расти настолько, насоклько Вы этого пожелаете!</p>\r\n<p class=\"about__inner-text\">Всего за 3 года компания открыла представительства в 33 странах мира: России, Казахстане, Киргизии, Республике Беларусь, Украине, Турции и странах Евросоюза, запустили 205 региональных центров в 34 городах. И это только начало.</p>\";s:4:\"tabs\";s:4:\"text\";s:12:\"media_upload\";i:0;s:7:\"toolbar\";s:4:\"full\";s:5:\"delay\";i:0;}", "About text", "about_text", "publish", "closed", "closed", "", "field_609284b5f0cf7", "", "", "2021-05-05 14:43:22", "2021-05-05 11:43:22", "", "35", "http://localhost/greenway/?post_type=acf-field&p=52", "13", "acf-field", "", "0");
